import styled from "styled-components";

const Header__upper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: absolute;
  width: 100%;
  height: 5rem;
  background-color: aqua;
  top: 0;
  border: 1px solid black;
`;

const MainLogo = styled.img`
  width: 20px;
  height: 20px;
`;
const Menus = styled.ul`
  display: flex;
  justify-content: space-evenly;
  min-width: 10rem;
`;
const Menu = styled.li`
  font-size: 1.5rem;
  font-weight: 400;
  margin-right: 1.5rem;
  list-style: none;
`;

const Logined = true;

function Header() {
  return (
    <Header__upper>
      <MainLogo src="../img/new_logo_nobackground.png" alt="Main Logo" />
      <Menus>
        <Menu>클럽 소개</Menu>
        <Menu>이벤트</Menu>
        <Menu>커뮤니티</Menu>
        <Menu>공지 사항</Menu>
        <Menu>문의하기</Menu>
        <Menu>마이페이지</Menu>
      </Menus>
    </Header__upper>
  );
}

export default Header;
